import React from 'react'
import CustomPrimaryButton from '../../shared/components/CustomPrimaryButton'

function LoginPageFooter({handleLogin,isFormValid}) {
    return (
        <div>
            <CustomPrimaryButton
            additionalStyles={{
                marginTop:'30px'
                }}
            label="Log in"
            disabled={!isFormValid}
            onClick={handleLogin}


            />
        </div>
    )
}

export default LoginPageFooter
